import { VISUALIZZA_CLIENTI } from "../actions/type";

const INITIAL_STATE = {
    isFound:false,
    isRetrieved:false,
    deleted:false,
    isUpdated:false,
    user:[],
    customer:{},
    
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case VISUALIZZA_CLIENTI:
            return {
                ...state,
                isRetrieved:true,
                user:action.payload
            };
        default:
            return state;
    }
};
